commit_message:
fix #1942 Commit 8572d796a95e92bbdaa827325a1ae82e1664dcba broke XTC/TRR reading on macOS.
This fixes this issue. Only the development version 0.18.1-dev was affected;
the released 0.18.0 did NOT have this bug.

Merge pull request #602 from MDAnalysis/issue-601 Issue 601: AtomGroup methods from TopologyAttrs (transplants)

Closes issue #601

@richardjgowers has implemented a scheme needed to accommodate methods like `AtomGroup.center_of_mass` within the context of `TopologyAttr`s, and this is done by the "transplants" mechanism. Also, the `Levels` scheme has been more solidly codified as an object that defines the relationship between the atoms->residues->segments levels that is central to the new topology system.

test dependencies in dedicated setuptools variables (see e.g. http://parijatmishra.wordpress.com/2008/10/08/python-packaging-setuptools-and-eggs/
for notes)

